import React, { Component } from 'react';
import { connect } from 'react-redux';
import { Card } from 'reactstrap'
import { hienThiCacKhuNha } from '../../../actions/khuNhaActions';
import { hienThiCacPhong } from '../../../actions/phongAction';

class DanhSachPhongTrong extends Component {
    constructor(props) {
        super(props);

        this.state = {
            id: ""
        }
    }

    render() {
        return (
            <div className="row" style={{ display: "block", clear: "both" }}>
                <div>
                    <center className="ten-khu-nha">KHU A1</center>
                    <div className="row">
                        <div className="col-md-3">
                            <Card className="ten-phong"><center>Phòng B1-506</center></Card>
                        </div>

                        <div className="col-md-3">
                            <Card>Phòng B1-504</Card>
                        </div>

                        <div className="col-md-3">
                            <Card>Phòng B1-503</Card>
                        </div>

                        <div className="col-md-3">
                            <Card>Phòng B1-502</Card>
                        </div>
                    </div>
                </div>

                <center>KHU B1</center>
                <div className="col-md-3">
                    <Card>Phòng B1-506</Card>
                </div>

            </div>
        )
    }
}

const mapStatetoProps = state => {
    return {
        khuNha: state.khuNha,
        phong: state.phong
    }
}

const mapActiontoProps = dispatch => {
    return {
        hienThiCacKhuNha: () => dispatch(hienThiCacKhuNha()),
        hienThiCacPhong: () => dispatch(hienThiCacPhong())
    }
}

export default connect(mapStatetoProps, mapActiontoProps)(DanhSachPhongTrong);
